import React, { View, Text } from 'react';
import {Typography, Button} from '@material-ui/core'
import image from 'assets/hitachi.png';
import h1 from 'assets/h1.png';
import bghitachi from 'assets/bghitachi.jpg'
import { DASHBOARD, ROOT } from 'navigation/CONSTANTS'
import {useHistory} from 'react-router-dom'

const HomeView = props =>{
    const history = useHistory();
    const goTo = (path) => {
        history.push(path || ROOT)
    }
    return (
        <div className="MuiContainer-root MuiContainer-maxWidthXs">
          <div className="jss1">
          <div class="MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12">
              <div class="MuiFormControl-root MuiTextField-root MuiFormControl-fullWidth">
                  <label class="MuiFormLabel-root MuiInputLabel-root MuiInputLabel-formControl MuiInputLabel-animated MuiInputLabel-outlined Mui-required Mui-required" data-shrink="false" for="HCCID" id="HCCID-label">HCCID<span aria-hidden="true" class="MuiFormLabel-asterisk MuiInputLabel-asterisk">&thinsp;</span></label>
                  <div class="MuiInputBase-root MuiOutlinedInput-root MuiInputBase-fullWidth MuiInputBase-formControl">
                      <input type="text" aria-invalid="false" id="HCCID" name="HCCID" required="" class="MuiInputBase-input MuiOutlinedInput-input" value=""/>
                          <fieldset aria-hidden="true" class="jss5 MuiOutlinedInput-notchedOutline">
                              <legend class="jss7"><span>HCCID&nbsp;*</span></legend>
                              </fieldset>
                    </div>
              </div>
          </div>
          </div>
        </div>
        )
}

export default HomeView;
